import React, { Component } from "react";
import "./cart.css";
import CartItem from "../cartItem/cartItem";

class Cart extends Component {
  render() {
    return (
      <div className="cart-body">
        <table className="table">
          <thead className="table-light">
            <tr>
              <th colspan="2">Product</th>
              <th>Count</th>
              <th>Price</th>
            </tr>
          </thead>
          <tbody>
            <CartItem />
          </tbody>
        </table>
      </div>
    );
  }
}

export default Cart;
